import React, { Component } from 'react';

import FirstImpression from './first-impression.component';
import About from './about.component';
import Portfolio from './portfolio.component';

class Home extends Component {
  state = {};
  render() {
    return (
      <div
        id="spy-wrapper"
        data-spy="scroll"
        data-target="#mainNav"
        data-offset="0"
      >
        <FirstImpression />
        <Portfolio />
        <About />
      </div>
    );
  }
}

export default Home;
